mod tests {
    use super::merge_k_sorted;
    use core::array::{Array, ArrayTrait};

    fn assert_array_eq(expected: @Array<i32>, actual: @Array<i32>, label: felt252) {
        let expected_len = expected.len();
        let actual_len = actual.len();
        assert!(expected_len == actual_len, label);
        let mut i: usize = 0;
        while i < expected_len {
            assert!(*expected[i] == *actual[i], label);
            i += 1;
        }
    }

    #[test]
    fn merge_normal() {
        let mut list1: Array<i32> = ArrayTrait::new();
        list1.append(1_i32);
        list1.append(4_i32);
        list1.append(5_i32);

        let mut list2: Array<i32> = ArrayTrait::new();
        list2.append(1_i32);
        list2.append(3_i32);
        list2.append(4_i32);

        let mut list3: Array<i32> = ArrayTrait::new();
        list3.append(2_i32);
        list3.append(6_i32);

        let mut lists: Array<Array<i32>> = ArrayTrait::new();
        lists.append(list1);
        lists.append(list2);
        lists.append(list3);

        let merged = merge_k_sorted(lists);

        let mut expected: Array<i32> = ArrayTrait::new();
        expected.append(1_i32);
        expected.append(1_i32);
        expected.append(2_i32);
        expected.append(3_i32);
        expected.append(4_i32);
        expected.append(4_i32);
        expected.append(5_i32);
        expected.append(6_i32);

        assert_array_eq(@expected, @merged, "normal merge");
    }

    #[test]
    fn merge_empty_input() {
        let lists: Array<Array<i32>> = ArrayTrait::new();
        let merged = merge_k_sorted(lists);
        let expected: Array<i32> = ArrayTrait::new();
        assert_array_eq(@expected, @merged, "empty input");
    }

    #[test]
    fn merge_with_empty_arrays() {
        let empty1: Array<i32> = ArrayTrait::new();
        let empty2: Array<i32> = ArrayTrait::new();

        let mut list: Array<i32> = ArrayTrait::new();
        list.append(2_i32);
        list.append(3_i32);

        let mut lists: Array<Array<i32>> = ArrayTrait::new();
        lists.append(empty1);
        lists.append(list);
        lists.append(empty2);

        let merged = merge_k_sorted(lists);

        let mut expected: Array<i32> = ArrayTrait::new();
        expected.append(2_i32);
        expected.append(3_i32);

        assert_array_eq(@expected, @merged, "empty arrays");
    }

    #[test]
    fn merge_single_array() {
        let mut list: Array<i32> = ArrayTrait::new();
        list.append(7_i32);
        list.append(9_i32);
        list.append(10_i32);

        let mut lists: Array<Array<i32>> = ArrayTrait::new();
        lists.append(list);

        let merged = merge_k_sorted(lists);

        let mut expected: Array<i32> = ArrayTrait::new();
        expected.append(7_i32);
        expected.append(9_i32);
        expected.append(10_i32);

        assert_array_eq(@expected, @merged, "single array");
    }

    #[test]
    fn merge_with_duplicates() {
        let mut list1: Array<i32> = ArrayTrait::new();
        list1.append(1_i32);
        list1.append(2_i32);
        list1.append(2_i32);

        let mut list2: Array<i32> = ArrayTrait::new();
        list2.append(2_i32);
        list2.append(2_i32);

        let mut lists: Array<Array<i32>> = ArrayTrait::new();
        lists.append(list1);
        lists.append(list2);

        let merged = merge_k_sorted(lists);

        let mut expected: Array<i32> = ArrayTrait::new();
        expected.append(1_i32);
        expected.append(2_i32);
        expected.append(2_i32);
        expected.append(2_i32);
        expected.append(2_i32);

        assert_array_eq(@expected, @merged, "duplicates");
    }
